import React from "react";

class Result extends React.Component {
  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          {/*.bind(this) */}
          <button type="submit">Back</button>
        </form>
      </div>
    );
  }
}

export default Result;
